  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  NWR outlines Refuge accomplishments from September through December of 1947. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments and plantings.
  Resource management is outlined; topics include grazing, haying, and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  hunting, and violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
